const Story = ({ story }) => {
  return (
    <>
      {story.map((el) => (
        <div key={el.id}>
          <textarea
            placeholder='Tell me your stories......'
            type='text'
            style={{
              width: '400px',
              height: '200px',
              marginTop: '20px',
              border: 'none',
            }}
          >
            <p> {el.title}</p>
          </textarea>
        </div>
      ))}
    </>
  )
}

export default Story
